import React from "react";
import moment from "moment";
import { Segment, Header, Icon } from "semantic-ui-react";

const Launch = props => (
  <Segment>
    <Header>{props.name}</Header>
    <Icon name="rocket" color="red" />
    <a href={props.rocket.link}>{props.rocket.name}</a><br/>
    <Icon name="group" />
    <a href={props.agency.link}>{props.agency.name}</a><br/>
    <Icon name="location arrow" color="blue" />
    <span>{props.location}</span><br/>
    <Icon name="clock" color="grey" />
    <span>{props.time}</span>
    {props.links.map((link, i) => (
      <div key={i}>{link}</div>
    ))}{" "}
  </Segment>
);

export default Launch;
